import React from 'react';
import { Link } from 'react-router-dom';
import './Welcome.css';  // Ensure the CSS is imported

function Welcome() {
    return (
        <div className="welcome-container">
            <div className="logo-container">
                <img src="/assets/logo.png" alt="EduConnect Logo" className="logo" />
            </div>
            <h1 className="welcome-title">Welcome to EduConnect!</h1>
            <p className="welcome-text">Your gateway to better learning and collaboration. Please log in or sign up to continue.</p>
            <div className="welcome-buttons">
                <Link to="/login" className="welcome-button">Log In</Link>
                <Link to="/signup" className="welcome-button">Sign Up</Link>
                <Link to="/about" className="welcome-button">About Us</Link>
                <Link to="/contact" className="welcome-button">Contact</Link>
            </div>
        </div>
    );
}

export default Welcome;
